import React from "react";
import Card from "./components/Card";
import "./sampleCar.css";
import Carousel from "react-elastic-carousel";
import Row_box from "./components/Row_box";
import NDatas from "./NData";
// import "./components/Card.css";
const breakPoints = [
  { width: 1, itemsToShow: 1 },
  { width: 550, itemsToShow: 2 },
  { width: 768, itemsToShow: 3 },
  { width: 1200, itemsToShow: 4 },
];

function fun(val) {
  return (
    // <div className="wrap">
    <Card img={val.img} title={val.title} link={val.link} />
    // </div>
  );
}
const SampleCar = () => {
  return (
    // <div className="sam1">
    <Carousel breakPoints={breakPoints}>{NDatas.map(fun)}</Carousel>
    // </div>
  );
};

export default SampleCar;
